import React from 'react'
import './Headline.css'

export default class Headline extends React.Component {
  constructor(props) {
    super(props)
  }
  render() {
    return(
      <div className="newsHeadline">
        <div className="headline">
          <div className="nameSubreddit">{this.props.title}</div>
          <div className="headlineSubreddit">{this.props.subreddit}</div>
        </div>
        <div className="newsThumbnail">{document.qerySelector('.newsThumbnail').style.background = this.props.thumbnai}</div>
      </div>
    )
  }
}
